import react from "react";
import { Nav, Container, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">سبز لرن</Navbar.Brand>
          <Nav className="me-auto">
            <Link to="/" style={{marginLeft: 20, color: "#fff"}}>خانه</Link>
            <Link to="/courses" style={{marginLeft: 20, color: "#fff"}}>دوره ها</Link>
            <Link to="/about" style={{marginLeft: 20, color: "#fff"}}>درباره ما</Link>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}
